import React, { Component } from "react";
import NavBar from "./components/navbar";

import { BrowserRouter } from "react-router-dom";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    var { isLoaded, items } = this.state;
    if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <BrowserRouter>
          <React.Fragment>
            <NavBar />

            <div>
              <Cardflip />
            </div>
          </React.Fragment>
        </BrowserRouter>
      );
    }
  }
}

export default App;
